//数组储存已打开视频窗口id
var openedIdArray = new Array();
Array.prototype.in_array = function (e) {
    for (i = 0; i < this.length; i++) {
        if (this[i] == e)
            return true;
    }
    return false;
};

Array.prototype.indexOf = function (val) {
    for (var i = 0; i < this.length; i++) {
        if (this[i] == val) return i;
    }
    return -1;
};

Array.prototype.remove = function (val) {
    var index = this.indexOf(val);
    if (index > -1) {
        this.splice(index, 1);
    }
};


/**
 * 
 * 打开div的位置
 * pt{
 * bindX:bindX,  //边界x
 * bindY:bindY,		//边界y
 * eventX:eventX,	//点击x
 * eventY:eventY,	//点击y
 * }
 * 
 *  el:element  //可移动div
 *  
 *  
 *  return top,left
 */

function openDiv_bind(el, pt) {
    var top = pt.eventY;
    var left = pt.eventX;
    var xDistance = pt.bindX - pt.eventX;
    var yDistance = pt.bindY - pt.eventY;
    if (xDistance < el.offsetWidth && yDistance < el.offsetHeight) {
        //alert(top+"右下角"+left);
        left = left - el.offsetWidth - 8;
        top = top - el.offsetHeight - 5;
    } else if (xDistance < el.offsetWidth) {
        //alert(top+"右上角"+left);
        left = left - el.offsetWidth - 8;
        top = top + 5;
    } else if (yDistance < el.offsetHeight) {
        //alert(top+"左下角"+left);
        left = left + 8;
        top = top - el.offsetHeight - 5;
    } else {
        //alert(xDistance+"正常"+el.offsetWidth);
        left = left + 8;
        top = top + 5;
    }
    return { 'top': top, 'left': left };
}
